import Router from "next/router";

const handleClickIndex = () => Router.push({ pathname: "/" });
export default function About() {
  return (
    <div className={styles.container}>
      <main className={styles.main}>
        <h1></h1>
        <a onClick={() => handleClickIndex()}>Home</a>

      </main>
    </div>
  );
}
